import styled from "styled-components"

const Divider = styled.div`
  background-color: #9B9B9B;
  height: 1px;
  margin-left: auto;
  margin-right: auto;
  margin-top: 10px;
  margin-bottom: 20px;
  width: 95%;
`
export default Divider
